pragma solidity ^0.8.0;

import "./AccessControl.sol";

contract SupplyChain is AccessControl {

    enum ShipmentStatus { 
        Created, 
        InTransit, 
        AtWarehouse, 
        OutForDelivery, 
        Delivered, 
        Cancelled 
    }

    struct Location {
        string latitude;
        string longitude;
        uint256 timestamp;
    }

    struct Shipment {
        uint256 id;
        string productName;
        string description;
        address manufacturer;
        address currentHandler;
        address recipient;
        ShipmentStatus status;
        uint256 createdAt;
        uint256 deliveredAt;
        Location[] locationHistory;
        string ipfsHash;  // For documents/images
        bool isActive;
    }

    uint256 public shipmentCounter;
    mapping(uint256 => Shipment) public shipments;
    mapping(address => uint256[]) public userShipments;

    // Events for real-time tracking
    event ShipmentCreated(uint256 indexed id, address indexed manufacturer, string productName);
    event StatusUpdated(uint256 indexed id, ShipmentStatus status, uint256 timestamp);
    event LocationUpdated(uint256 indexed id, string latitude, string longitude, uint256 timestamp);
    event HandlerChanged(uint256 indexed id, address indexed oldHandler, address indexed newHandler);
    event ShipmentDelivered(uint256 indexed id, uint256 timestamp);

    constructor() {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function createShipment(
        string memory _productName,
        string memory _description,
        address _recipient,
        string memory _ipfsHash
    ) external onlyRole(MANUFACTURER_ROLE) returns (uint256) {
        shipmentCounter++;

        Shipment storage newShipment = shipments[shipmentCounter];
        newShipment.id = shipmentCounter;
        newShipment.productName = _productName;
        newShipment.description = _description;
        newShipment.manufacturer = msg.sender;
        newShipment.currentHandler = msg.sender;
        newShipment.recipient = _recipient;
        newShipment.status = ShipmentStatus.Created;
        newShipment.createdAt = block.timestamp;
        newShipment.ipfsHash = _ipfsHash;
        newShipment.isActive = true;

        userShipments[msg.sender].push(shipmentCounter);
        userShipments[_recipient].push(shipmentCounter);

        emit ShipmentCreated(shipmentCounter, msg.sender, _productName);

        return shipmentCounter;
    }

    function updateLocation(
        uint256 _shipmentId,
        string memory _latitude,
        string memory _longitude
    ) external {
        Shipment storage shipment = shipments[_shipmentId];
        require(shipment.isActive, "Shipment not active");
        require(
            shipment.currentHandler == msg.sender || hasRole(TRANSPORTER_ROLE, msg.sender),
            "Not authorized"
        );

        shipment.locationHistory.push(Location({
            latitude: _latitude,
            longitude: _longitude,
            timestamp: block.timestamp
        }));

        emit LocationUpdated(_shipmentId, _latitude, _longitude, block.timestamp);
    }

    function updateStatus(
        uint256 _shipmentId,
        ShipmentStatus _status
    ) external {
        Shipment storage shipment = shipments[_shipmentId];
        require(shipment.isActive, "Shipment not active");
        require(
            shipment.currentHandler == msg.sender || hasRole(TRANSPORTER_ROLE, msg.sender),
            "Not authorized"
        );

        shipment.status = _status;

        if (_status == ShipmentStatus.Delivered) {
            shipment.deliveredAt = block.timestamp;
            shipment.isActive = false;
            emit ShipmentDelivered(_shipmentId, block.timestamp);
        }

        emit StatusUpdated(_shipmentId, _status, block.timestamp);
    }

    function transferHandler(
        uint256 _shipmentId,
        address _newHandler
    ) external {
        Shipment storage shipment = shipments[_shipmentId];
        require(shipment.isActive, "Shipment not active");
        require(shipment.currentHandler == msg.sender, "Not current handler");

        address oldHandler = shipment.currentHandler;
        shipment.currentHandler = _newHandler;
        userShipments[_newHandler].push(_shipmentId);

        emit HandlerChanged(_shipmentId, oldHandler, _newHandler);
    }

    function getShipment(uint256 _shipmentId) 
        external 
        view 
        returns (
            uint256 id,
            string memory productName,
            string memory description,
            address manufacturer,
            address currentHandler,
            address recipient,
            ShipmentStatus status,
            uint256 createdAt,
            uint256 deliveredAt,
            string memory ipfsHash,
            bool isActive
        ) 
    {
        Shipment storage shipment = shipments[_shipmentId];
        return (
            shipment.id,
            shipment.productName,
            shipment.description,
            shipment.manufacturer,
            shipment.currentHandler,
            shipment.recipient,
            shipment.status,
            shipment.createdAt,
            shipment.deliveredAt,
            shipment.ipfsHash,
            shipment.isActive
        );
    }

    function getLocationHistory(uint256 _shipmentId) 
        external 
        view 
        returns (Location[] memory) 
    {
        return shipments[_shipmentId].locationHistory;
    }

    function getUserShipments(address _user) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return userShipments[_user];
    }
}
